import React from 'react'
import {
  Table,
  TableBody,
  TableCell,
  TableContainer,
  TableFooter,
  TablePagination,
  TableRow,
  IconButton
} from '@material-ui/core';
import {makeStyles, useTheme} from '@material-ui/core/styles';
import {FirstPageIcon, KeyboardArrowLeft, KeyobardArrowRight, LastPageIcon} from '@material-ui/icons';
import PropTypes from 'prop-types';

function createData(name, code, population, size) {
  const density = population / size;
  return { name, code, population, size, density };
}

const rows = [
  createData('India', 'IN', 1324171354, 3287263),
  createData('China', 'CN', 1403500365, 9596961),
  createData('Italy', 'IT', 60483973, 301340),
  createData('United States', 'US', 327167434, 9833520),
  createData('Canada', 'CA', 37602103, 9984670),
  createData('Australia', 'AU', 25475400, 7692024),
  createData('Germany', 'DE', 83019200, 357578),
  createData('Ireland', 'IE', 4857000, 70273),
  createData('Mexico', 'MX', 126577691, 1972550),
  createData('Japan', 'JP', 126317000, 377973),
  createData('France', 'FR', 67022000, 640679),
  createData('United Kingdom', 'GB', 67545757, 242495),
  createData('Russia', 'RU', 146793744, 17098246),
  createData('Nigeria', 'NG', 200962417, 923768),
  createData('Brazil', 'BR', 210147125, 8515767),
];

function TablePaginationActions(props) {
  const classes = useStyles1();
  const theme = useTheme();
  const {count, page, rowsPerPage, onChangePage} = props;

  const handleFirstPageButtonClick = (event) => {
    onChangePage(event, 0);
  };

  const handleBackButtonClick = (event) => {
    onChangePage(event, page - 1);
  };

  const handleNextButtonClick = (event) => {
    onChangePage(event, page + 1);
  };

  const handleLastPageButtonClick = (event) => {
    onChangePage(event, Math.max(0, Math.ceil(count / rowsPerPage) - 1));
  };

  return (<div className={classes.root}>
    <IconButton onClick={handleFirstPageButtonClick} disabled={page === 0} aria-label="first page">
      {
        theme.direction === 'rtl'
          ? <LastPageIcon/>
          : <FirstPageIcon/>
      }
    </IconButton>
    <IconButton onClick={handleBackButtonClick} disabled={page === 0} aria-label="previous page">
      {
        theme.direction === 'rtl'
          ? <KeyboardArrowRight/>
          : <KeyboardArrowLeft/>
      }
    </IconButton>
    <IconButton onClick={handleNextButtonClick} disabled={page >= Math.ceil(count / rowsPerPage) - 1} aria-label="next page">
      {
        theme.direction === 'rtl'
          ? <KeyboardArrowLeft/>
          : <KeyboardArrowRight/>
      }
    </IconButton>
    <IconButton onClick={handleLastPageButtonClick} disabled={page >= Math.ceil(count / rowsPerPage) - 1} aria-label="last page">
      {
        theme.direction === 'rtl'
          ? <FirstPageIcon/>
          : <LastPageIcon/>
      }
    </IconButton>
  </div>);
}

TablePaginationActions.propTypes = {
  count: PropTypes.number.isRequired,
  onChangePage: PropTypes.func.isRequired,
  page: PropTypes.number.isRequired,
  rowsPerPage: PropTypes.number.isRequired
};

function TransactionsList() {
  const [page, setPage] = React.useState(0);
  const [rowsPerPage, setRowsPerPage] = React.useState(5);

  const emptyRows = rowsPerPage - Math.min(rowsPerPage, rows.length - page * rowsPerPage);

  const handleChangePage = (event, newPage) => {
    setPage(newPage);
  };

  const handleChangeRowsPerPage = (event) => {
    setRowsPerPage(parseInt(event.target.value, 10));
    setPage(0);
  };

  return (<TableContainer component={Paper}>
    <Table className={classes.table} aria-label="custom pagination table">
      <TableBody>
        {
          (
            rowsPerPage > 0
            ? rows.slice(page * rowsPerPage, page * rowsPerPage + rowsPerPage)
            : rows).map((row) => (<TableRow key={row.name}>
              <TableCell component="th" scope="row">
                {row.name}
              </TableCell>
              <TableCell align="right">{row.calories}</TableCell>
              <TableCell align="right">{row.fat}</TableCell>
            </TableRow>))
        }

        {
          emptyRows > 0 && (<TableRow style={{
              height: 53 * emptyRows
            }}>
            <TableCell colSpan={6}/>
          </TableRow>)
        }
      </TableBody>
      <TableFooter>
        <TableRow>
          <TablePagination rowsPerPageOptions={[
              5,
              10,
              25, {
                label: 'All',
                value: -1
              }
            ]} colSpan={3} count={rows.length} rowsPerPage={rowsPerPage} page={page} SelectProps={{
              inputProps: {
                'aria-label': 'rows per page'
              },
              native: true
            }} onChangePage={handleChangePage} onChangeRowsPerPage={handleChangeRowsPerPage} ActionsComponent={TablePaginationActions}/>
        </TableRow>
      </TableFooter>
    </Table>
  </TableContainer>);

}

export default TransactionsList;
